import './App.css';
import Nav from './component/Nav';
import {BrowserRouter} from 'react-router-dom'

function App() {
  return (
    <div className="App">
     <BrowserRouter>
        <Nav/>
     </BrowserRouter>

     <h1>E-Dashboard</h1>
    </div>
  );
}

export default App;
